import React from "react";
import "./body.css";
import Contact from "../components/contact";


export default function Body(props) {
  return (
    <div id="body">
          <ul contacts={props.contacts}>
      {props.contacts.map(function (value, index) {
        return (
          <Contact
            key={index}
            contact={value}
            onDeleteContact={props.onDeleteContact}
          ></Contact>
        );
      })}
    </ul>
    </div>
  );
}
